import React from "react";
import "./Home.css";
import EqualizerIcon from "@material-ui/icons/Equalizer";
import Product from "./Product.js";
import Items from "./ProductItems.js";

function Home() {
  return (
    <>
      {/* home */}
      <div className="container-fluid home">
        <div className="row">
          {/* home left */}
          <div className="col-lg-4 hidden-xs home_left">
            <img
              className="home_img"
              src="./images/helpng.png"
              alt="no image"
            />
          </div>
          {/* home mid */}
          <div className="col-lg-4  col-xs-12 home_right">
            <h3 className="head">
              Never say never <br />
              because limits, like fears, are often just an illusion.
            </h3>
            <div className=" home_btn">
              <button className="btn btn-primary btn1">Buy Now</button>
              <button className="btn btn-success btn2 ">Offers</button>
            </div>
          </div>

          {/* home right */}
          <div className="col-lg-4 col-xs-6">
            {/* home cards */}
            <div className="cards">
              <div className="well">
                <div className="card_icon">
                  <EqualizerIcon></EqualizerIcon>
                </div>
                <div className="card_heading">PERFORMANCE</div>
                <div className="card_txt">
                  designed for a secure and comfortable fit for long days in the
                  field.
                </div>
              </div>
              <div className="well">
                <div className="card_icon">
                  <EqualizerIcon></EqualizerIcon>
                </div>
                <div className="card_heading">PERFORMANCE</div>
                <div className="card_txt">
                  designed for a secure and comfortable fit for long days in the
                  field.
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>

      {/* products */}
      <div className="rows">
        {Items.map((val) => {
          return <Product name={val.name} image={val.image} />;
        })}
      </div>
    </>
  );
}

export default Home;
